    <div className="expenses">
      <ExpenseItem title={title[0]} amount={amount[0]} date={date[0]} />

      <ExpenseItem title={title} amount={amount} date={date} />

      <ExpenseItem title={title} amount={amount} date={date} />
    </div>
  );
};

export default Expenses;
